import React, { Component } from 'react';

import './SelectOpt';
import './Checkbox';
import { Button, Col, Container, Form, Input, Modal, Row } from 'reactstrap';
import Heels from './images/heels.png';
import Topuklu from './images/kadıntopuklu.jpeg';
import tracker from '../src/api/tracker'
import AliceCarousel from 'react-alice-carousel';
import "react-alice-carousel/lib/alice-carousel.css";
class womenHeels extends Component {
    constructor() {
        super();
        this.state = {
            products: [],
            images: [Heels, Topuklu, Topuklu]
        }
    }

    componentDidMount = async () => {
        try {
            const response = await tracker.get('product/gender/female/category/Heels');
            const arrayproduct = response.data;
            this.setState({ products: arrayproduct });
            console.log("state", this.state.products)
        } catch (e) {

        }
    }
    handleProducts = () => {
        console.log("handleproduct");
        var product = [];
        if (this.state.products.length !== 0) {
            var productitem;
            for (var i = 0; i < this.state.products.length; i++) {
                productitem =
                    <div className="card" style={{ width: "25vh", height: "50vh", margin: "2vh"  }}>
                            <AliceCarousel 
                        disableButtonsControls = {true}
                        responsive autoPlay autoPlayInterval="3000" style={{ height: "40vh", marginBottom:"5vh"}}>
                           <img style={{ width: "25vh", height: "25vh" }} src={this.state.images[i]} alt="High Heels" />
                           <img style={{ width: "25vh", height: "25vh" }} src={this.state.images[0]} alt="High Heels" />

                        </AliceCarousel>
                       
                        <h4>{this.state.products[i].name}</h4>
                        <p class="price">${this.state.products[i].price}</p>
                        <p>{this.state.products[i].definition}</p>
                        <p><button>Add to Cart</button></p>
                    </div>
                product.push(productitem);

            }
            for (var i = 0; i < this.state.products.length; i++) {
                productitem =
                    <div className="card" style={{ width: "25vh", height: "50vh", margin: "2vh"  }}>
                        <img style={{ width: "25vh", height: "25vh" }} src={this.state.images[i]} alt="High Heels" />
                        <h4>{this.state.products[i].name}</h4>
                        <p class="price">${this.state.products[i].price}</p>
                        <p>{this.state.products[i].definition}</p>
                        <p><button>Add to Cart</button></p>
                    </div>
                product.push(productitem);

            }
            for (var i = 0; i < this.state.products.length; i++) {
                productitem =
                    <div className="card" style={{ width: "25vh", height: "50vh", margin: "2vh" }}>
                        <img style={{ width: "25vh", height: "25vh" }} src={this.state.images[i]} alt="High Heels" />
                        <h4>{this.state.products[i].name}</h4>
                        <p class="price">${this.state.products[i].price}</p>
                        <p>{this.state.products[i].definition}</p>
                        <p><button>Add to Cart</button></p>
                    </div>
                product.push(productitem);

            }

            console.log("product ", product)
            return product;
        }
    }

    render() {

        return (
            <>
                <Container style={{ width: "auto", textAlign: "-webkit-center" }} >

                    <div className="card" style={{ width: "auto", marginRight: "1vh", marginLeft: "1vh", maxWidth: "initial" }}>
                        <h1 className="mt-5">Woman Heels</h1>
                        <Row style={{ margin: "5vh" , justifyContent:"space-between"}}>
                            {this.handleProducts()}
                        </Row>

                    </div>
                </Container>

            </>
        );
    }

}
export default womenHeels;
